import React from 'react';

const Card = () => {
    return(
        
        <div className="bg-light-green ">
           
            <img alt="robot" src="https://robohash.org/test?200x200"></img>
            <div>
                <h2>Damjan Karlovski</h2>
                <p>damjan_karlovski@hotmail.com</p>
            </div>
        </div>
    );
}

export default Card;
